const Card = (props) => {
	return (
		<div className = 'tc bg-light-blue dib br3 pa3 ma2 bw2 shadow-5 grow'>
			<img alt='robot' src={`https://robohash.org/${props.name}?150x150`}/>
			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
	);
}

export default Card;
